(1, 'আপনার সন্তাকে নিয়মিত ভাবে বিদ্যালয়ে পাঠান। এবং আপনার সন্তানের যাবতীয় বকেয়া পাওনা পরিশোধ করার জন্য বিশেষ ভাবে বলা যাচ্ছে।  অধ্যক্ষ- আল  হেরা শিশু একাডেমী', '2020-12-01 18:00:00', '2023-07-27 20:38:40');
