INSERT INTO `main_descriptions` (`id`, `title`, `body`, `image`, `created_at`, `updated_at`) VALUES
(1, 'আল হেরা শিশু একাডেমীর পক্ষ থেকে আপনাকে স্বাগতম', '<p>প্রিয় সুধী,&nbsp;<br />\r\nএকজন শিশুর শিক্ষা শুরু হয় তার মা-বাবার কাছ থেকে। এরপরই আসে স্কুলের নাম। পরিবারের পর একটি স্কুল শিশুর জীবনে অপরিহার্য ভূমিকা রাখে। তাই শিশুর সঠিকভাবে বেড়ে ওঠার ক্ষেত্রে স্কুলের অবদান অনেক, সেটা বলার অপেক্ষা রাখে না। স্কুলের নিয়মকানুন,&nbsp;স্কুলের সংস্কৃতি&mdash;সবকিছুই ছাত্রছাত্রীদের প্রভাবিত করে। যেমন স্কুলের রুটিন শিশুকে শেখায় সময়ানুবর্তিতা। স্কুলের বিভিন্ন খেলাধুলা দলগত কাজ করার মানসিকতা গড়ে তোলে। একটি স্কুল যদি মৌলিক, মানবিক নীতি-নৈতিকতা ও মূল্যবোধের ওপর জোর দেয়,&nbsp;তাহলে শিশুরা সহজেই তা তাদের জীবনে প্রয়োগ করতে পারে। ভালো ব্যবহার করা, বড়দের শ্রদ্ধা করা, ছোটদের সাহায্য করা, অন্যদের সহযোগিতা করা, সততা, নিয়মানুবর্তিতা&mdash;এই সবকিছুর শিক্ষা পরিবারের পাশাপাশি স্কুলে চর্চা করতে হবে। স্কুলও অভিভাবক। এখান থেকে ভালো যা কিছু শিখবে, ছাত্রছাত্রীরা তা জীবনে সঠিকভাবে প্রয়োগ করতে পারবে।<br />\r\nঅধ্যক্ষ,<br />\r\nআল হেরা শিশু একাডেমী,<br />\r\nআমবাড়ী, ডোমার, নীলফামারী।</p>', 'public/backend/upload/main_description/1750667399301374.jpg', '2020-12-01 18:00:00', '2022-11-27 10:28:55');
