INSERT INTO `notices` (`id`, `title`, `slug`, `body`, `image`, `created_at`, `updated_at`) VALUES
(16, 'অর্ধ-বার্ষিক পরীক্ষার রুটিন-২০২১', 'ordh-barshik-preekshar-rutin-2021', '<p>অর্ধ-বার্ষিক পরীক্ষার রুটিন-২০২১। নার্সারী হতে পঞ্চম শ্রেণির জন্য।</p>', 'public/backend/upload/notice/1712078362054465.jpg', '2021-09-27 16:52:42', '2021-09-27 16:56:08'),
(17, 'ভর্তি চলিতেছে, ভর্তি চলিতেছে, ভর্তি চলিতেছে', 'vrti-cliteche-vrti-cliteche-vrti-cliteche', 'ভর্তি চলিতেছে, ভর্তি চলিতেছে, ভর্তি চলিতেছে। ২০২২ খ্রিঃ শিক্ষাবর্ষে নার্সারী থেকে অষ্টম শ্রেনীর ছাত্র/ছাত্রীদের ভর্তি চলিতেছে। ফরম সংগ্রহ ও জমাদান কার্যক্রম চলছে। তাই আজই আপন সন্তানের জন্য অফিস চলাকালী সময়ে ফরম সংগ্রহ করুন। প্রয়োজনে মোবাইল নং-01714821463 ...................ধন্যবাদ।', NULL, '2021-11-26 18:51:44', '2021-11-26 18:51:44'),
(18, 'প্রথম সাময়িক পরীক্ষা', 'prthm-samyik-preeksha', 'সুধী, আগামী ১৪ই মে, রোজ রবিবার থেকে নার্সারী হতে পঞ্চম শ্রেনী পর্যন্ত প্রথম সাময়িক পরীক্ষা অনুষ্ঠিত হবে। তাই আপনার সন্তানের সকল পাওনা পরিশোধ করে প্রবেশ পত্র সংগ্রহ  করার জন্য বিশেষ ভাবে বলা যাচ্ছে। অনুরোধ ক্রমে অধ্যক্ষ আল হেরা শিশু একাডেমী। প্রয়োজনে মোবাইল নং-01714821463.', NULL, '2023-05-06 09:40:51', '2023-05-06 09:40:51');
